import React, { useState } from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { changeTabActive } from "../redux/actions";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

const NavBar = () => {
    const dispatch = useDispatch();
    const activeTab = useSelector(state => state.activeTab);
    const [statusNav, changeStatusNav] = useState(null);

    const toggleNav = () => {
        changeStatusNav(statusNav === null ? "active" : null);
    };

    const changeTab = (value) => {
        dispatch(changeTabActive(value));
        toggleNav();
    };

    return (
        <header>
            <div className="logo">Portfolio</div>
            <nav className={statusNav}>
                <Link to="/" className={activeTab === "home" ? "active" : ""} onClick={() => changeTab("home")}>Home</Link>
                <Link to="/about-me" className={activeTab === "about-me" ? "active" : ""} onClick={() => changeTab("about-me")}>About Me</Link>
                <Link to="/projects" className={activeTab === "projects" ? "active" : ""} onClick={() => changeTab("projects")}>Projects</Link>
                <Link to="/contacts" className={activeTab === "contacts" ? "active" : ""} onClick={() => changeTab("contacts")}>Contacts</Link>
            </nav>
            <div className="icon-bar" onClick={toggleNav}>
                <FontAwesomeIcon icon={faBars} />
            </div>
        </header>
    );
};

export default NavBar;
